import logo from './logo.svg';
import React from 'react';
import { Link } from "react-router-dom";

function HomePage() {
  return (
    <div>
      <h1>
        Home page</h1> 
      
        <br />
            <ul>
                <li>
                    <Link to = "/">ProductPage</Link>
                    <Text>
                        Product Page
                    </Text>
                </li>
            </ul>
  
    </div>
  );
}

export default HomePage;
